import Layout from '../components/MyLayout';
import axios from 'axios';
import styled from 'styled-components';

const New = props => {

  return (
    <Layout>
      <form>
          <h2 class="form__heading">New post</h2>
          <label class="form__item">Title
            <input type="text" name="email" class="input form__input" placeholder="Your email" autocomplete="off" />
          </label>
          <label class="form__item">
            <textarea name="message" class="input form__input-textarea form__input" placeholder="Your message"></textarea>
          </label>
          <button type="submit" class="button form__button">Send</button>
        </form>
    </Layout>
  );
}

export default New;
